var TmplHandler;

(function($){

    TmplHandler = function(options) {
        this.defaults = { language: drupalSettings.hia_fids.language, UTCTimeOffset: 3, tmplURL: "js/tmpl/tmpl.html" };
        this.options = $.extend(this.defaults, options);
    };
    var _op = { language: drupalSettings.hia_fids.language}
    TmplHandler.fn = TmplHandler.prototype;

    TmplHandler.fn.init = function(pCallback){

        var _this = this;
        var _op = _this.options;

        $.ajax({
            url         : _op.tmplURL,
            type        : 'GET',
            dataType    : 'html',
            cache       : true,
            success     : function(tmpl){

                var $tmpl = $(tmpl);

                _this.tmplsIndex = [];
                _this.tmplsData = [];

                $.each($tmpl, function(pIndex, pData){
                    if(pData.type === "text/template"){
                        _this.tmplsIndex.push($(pData).attr("id"));
                        _this.tmplsData.push(Handlebars.compile($(pData).html()));
                    }
                });

                if(pCallback)pCallback(_this.tmplsIndex);

            },
            error : function(e){
                console.log(e);
            }
        });

    };

    TmplHandler.fn.getTmplByID = function(pID, pObj){
        var _this = this;
        var index = _this.tmplsIndex.indexOf(pID);
        if(index >= 0){
            var tmpl = _this.tmplsData[index];
            return (pObj) ? tmpl(pObj) : tmpl;
        } else {
            return false;
        }
    };


    var getTimeString = function (pTS) {
        return moment.utc(pTS * 1000).zone('+03:00').format('HH:mm');
    };

    var getDateString = function (pTS) {
        return moment.utc(pTS * 1000).zone('+03:00').format('DD/MM/YY');
    };

    var getTimeAndStatus = function (pObj) {
        var status = "";
        var time = "";
        if (pObj.type == "arrivals") {

            if (pObj.actualTimeOfArr && pObj.scheduledTime && !pObj.cancelled) {
                time = pObj.actualTimeOfArr;
                status = Drupal.t('Arrived');
            } else if (!pObj.actualTimeOfArr && pObj.scheduledTime && !pObj.cancelled) {
                time = pObj.estimateTime;
                status = Drupal.t('Expected');
            } else {
                time = pObj.actualTimeOfArr;
                status = "";
            }
        } else {
            if (pObj.actualTimeOfDep && pObj.scheduledTime && !pObj.cancelled) {
                time = pObj.actualTimeOfDep;
                status = Drupal.t('Departed');
            } else if (!pObj.actualTimeOfDep && pObj.scheduledTime && !pObj.cancelled) {
                time = pObj.estimateTime;
                status = Drupal.t('Expected');
            } else {
                time = pObj.actualTimeOfDep;
                status = "";
            }
        }
        status = Handlebars.helpers.langHelper("flightStatus", pObj.lang) //pObj.lang.en.flightStatus // Added on 19-06-2017
        return { 'time': (time) ? time : pObj.scheduledTime, 'status': status };
    };

    Handlebars.registerHelper('langHelper', function (pDataName, pObj) {
        var txt = (_op.language == "en") ? pObj['en'][pDataName] : pObj['ar'][pDataName]
        txt = (txt) ? txt : pObj['en'][pDataName];
        return (txt) ? txt : "&nbsp;";
    });

    Handlebars.registerHelper('typeAndLangHelper', function (pType, pObj) {
        var lang = (_op.language == "en") ? "en" : "ar";
        var type = (pType == "arrivals") ? "originName" : "destinationName";
        var txt = (pObj[lang][type]) ? pObj[lang][type] : pObj["en"][type];
        return (txt) ? txt : '&nbsp';
    });

    Handlebars.registerHelper('viaFlightHelper', function (pType, pObj) {
        var lang = (_op.language == "en") ? "en" : "ar";
        var type = "viaName";
        var txt = (pObj[lang][type]) ? pObj[lang][type] : pObj["en"][type];
        return (txt)? (' via ' +txt) : '&nbsp';
    });


    Handlebars.registerHelper('getLeftRight', function (pPos) {
        if (_op.language == "en") {
            return (pPos == 'left') ? 'left' : 'right';
        } else {
            return (pPos == 'left') ? 'right' : 'left';
        }
    });

    Handlebars.registerHelper('getTimeString', function (pTS) {
        return getTimeString(pTS);
    });

    Handlebars.registerHelper('formatDateTimeString', function (pObj) {
        return getTimeString(getTimeAndStatus(pObj).time) + ', ' + getDateString(getTimeAndStatus(pObj).time);
    });

    Handlebars.registerHelper('flightStatus', function (pObj) {
        return getTimeAndStatus(pObj).status;
    });

    Handlebars.registerHelper('flightTime', function (pObj) {
        return getTimeString(getTimeAndStatus(pObj).time);
    });

    Handlebars.registerHelper('flightTimeNStatus', function (pObj) {
        var status = getTimeAndStatus(pObj).status;
        var spanTag = "";
        if (getTimeAndStatus(pObj).time) {
            if (getTimeAndStatus(pObj).time == pObj.scheduledTime) {
                spanTag = status;
            } else {
                spanTag = (status != Drupal.t('Arrived')) ? status + " " + getTimeString(getTimeAndStatus(pObj).time) : status;
            }
        } else {
            spanTag = status;
        }
        if(status == 'Delayed' || status == 'Cancelled') {
            spanTag = "<span class='status_alert'>"+spanTag+"</span>";
        } else {
            spanTag = "<span class='general'>"+spanTag+"</span>";
        }
        return spanTag;
    });

    Handlebars.registerHelper('sliderCheckIndex', function (pIndex) {
        return (!pIndex) ? 'active' : '';
    });

    Handlebars.registerHelper('flightLocation', function (pObj) {
        if (pObj.type == 'arrivals') {
            if (!pObj.lang[_op.language].originName) return '';
        } else {
            if (!pObj.lang[_op.language].destinationName) return '';
        }
        return (pObj.type == 'arrivals') ? Drupal.t('from ') + pObj.lang[_op.language].originName : Drupal.t('to ') + pObj.lang[_op.language].destinationName;
    });

    Handlebars.registerHelper('getTabInnerOptions', function (pObj) {
        if (pObj.display != 'select') {
            return '';
        } else {
            return _this.getTmplByID('innerSliderOptions', pObj);
        }
    });

    Handlebars.registerHelper('gateOrBelt', function (pObj) {
        if (pObj.type == 'departures') {
            if (pObj.gateNoGeneral){
        //        return '<i class="icon-gate"></i>' + Drupal.t('Gate') + ' ' + pObj.gateNoGeneral;
                 return ''+Drupal.t('Gate') +" "+pObj.gateNoGeneral;
                 }
            else
                return 'Not Assigned';
        } else {
            if (pObj.BaggageBelt){
            //return '<i class="icon-baggagebelt"></i>'+ Drupal.t('Belt') + ' ' + pObj.BaggageBelt;
             return ''+Drupal.t('Belt') + ' ' + pObj.BaggageBelt;
             }

        else
            return 'Not Assigned';
        }
    });

    Handlebars.registerHelper('translateTxt', function (pTxt) {
        return Drupal.t(pTxt);
    });

    var popupFlightsDetails = function (data) {
        return moment.utc(pTS * 1000).zone('+03:00').format('DD/MM/YY');
    };

})(jQuery);
;
