var FlightStatusFilter;
(function($){

	FlightStatusFilter = function(options) {
        this.defaults = {
            airlineID       : '#allAirlines',
            dateID          : '#date',
            locationID      : '#from'
        };
        this.options = $.extend(this.defaults, options);
        this.type = 'arrivals';
    };

    FlightStatusFilter.fn = FlightStatusFilter.prototype;

    FlightStatusFilter.fn.init = function(pColl, pType, pCallback){
        var _this = this, _op = this.options;
            _this.type = pType;
        var initFilter = function(pFieldName, $pEl, pAllTxt, pFieldTxt){
            pColl.comparator = function(model) {
                return (model.get('lang')[drupalSettings.hia_fids.language][pFieldTxt]) ? model.get('lang')[drupalSettings.hia_fids.language][pFieldTxt] : model.get(pFieldName);
            }
            pColl.sort();
            var pluckArr = pColl.pluck(pFieldName, pFieldTxt);
            var uniPluckArr = _.uniq(pluckArr);
            var mergeArr = [];
            var curLang = drupalSettings.hia_fids.language;
            if(pFieldTxt){
                for(var i=0; i<uniPluckArr.length; i++){
                    var obj = {};
                        obj[pFieldName] = uniPluckArr[i];
                    var filterArr = pColl.where(obj);
                        obj[pFieldTxt] = filterArr[0].get("lang")[curLang][pFieldTxt];
                    mergeArr.push(obj);
                }
            }
            $pEl.empty();
            $pEl.append('<option value="all">'+Drupal.t(pAllTxt)+'</option>');
            for(var i=0; i<mergeArr.length; i++){
                $pEl.append('<option value="'+mergeArr[i][pFieldName]+'">'+((mergeArr[i][pFieldTxt]) ? mergeArr[i][pFieldTxt] : mergeArr[i][pFieldName])+'</option>');
            }
        };
        initFilter('airlineCode', $(_op.airlineID), Drupal.t('All'), 'airlineName');
        if(pType == "departures")
            initFilter('destinationCode', $(_op.locationID), Drupal.t('All'), 'destinationName');
        else
            initFilter('originCode', $(_op.locationID), 'All', 'originName');
    };

    FlightStatusFilter.fn.getFilterObj = function(){
        var _this = this, _op = this.options;
        var obj = {};
        var airlineVal = $(_op.airlineID).val();
        var locationVal =  $(_op.locationID).val();
        if(airlineVal != 'all')
            obj['airlineCode'] = airlineVal;
        if(locationVal != 'all'){
            obj[((_this.type == 'departures') ? 'destinationCode' : 'originCode')] = locationVal;
        }
        if(airlineVal == 'all' && locationVal == 'all')
            return false;

        return obj;
    };

    FlightStatusFilter.fn.reset = function(){
        var _this = this, _op = this.options;
        $(_op.airlineID).children('option').removeAttr('disabled');
        $(_op.airlineID).val('all');
        $(_op.locationID).children('option').removeAttr('disabled');
        $(_op.locationID).val('all');
    };

    FlightStatusFilter.fn.filterOptions = function(pFilterTarget, pDatas){
        var _this = this, _op = this.options;
        var datasCollection = new Backbone.Collection(pDatas);
        var filterOption = function(pFieldName, pEl){
            var datasArr = _.union(datasCollection.pluck(pFieldName));
            pEl.children('option').attr('disabled','disabled');
            for(var i=0; i<datasArr.length; i++){
                pEl.children('option[value='+datasArr[i]+']').removeAttr('disabled');
            }
            pEl.children('option[value=all]').removeAttr('disabled');
        };
        if(pFilterTarget == 'airline'){
            filterOption('airlineCode', $(_op.airlineID));
        } else if(pFilterTarget == 'location'){
            if(_this.type == 'arrivals')
                filterOption('originCode', $(_op.locationID));
            else
                filterOption('destinationCode', $(_op.locationID));
        } else if(pFilterTarget == 'keyword'){
            filterOption('airlineCode', $(_op.airlineID));
            if(_this.type == 'arrivals')
                filterOption('originCode', $(_op.locationID));
            else
                filterOption('destinationCode', $(_op.locationID));
        }
    };

    FlightStatusFilter.fn.getAirlineValue = function(){
        return $(this.options.airlineID).val();
    };

    FlightStatusFilter.fn.getAirlineFilter = function(){
        return $(this.options.airlineID);
    };

})(jQuery);
