            var flightNumStr = model.get('flightNumber').toLowerCase();
            var airlineNameStr = langObj['airlineName'].toLowerCase();
            var locationNameStr = (model.get('type') == 'arrivals') ? langObj['originName'] : langObj['destinationName'];
                locationNameStr = (locationNameStr) ? locationNameStr.toLowerCase() : "";
            var passArry = [];
                passArry.push((pFilterObj.airlineCode) ? model.get('airlineCode') == pFilterObj.airlineCode : true);
                passArry.push((pFilterObj.destinationCode) ? model.get('destinationCode') == pFilterObj.destinationCode : true);
                passArry.push((pFilterObj.originCode) ? model.get('originCode') == pFilterObj.originCode : true);
                passArry.push((pText) ? (   (flightNumStr.indexOf(pText.toLowerCase()) > -1) ||
                                            (airlineNameStr.indexOf(pText.toLowerCase()) > -1) ||
                                            (locationNameStr.indexOf(pText.toLowerCase()) > -1)
                                        ) : true);
